import React from 'react';
import Grid from '@mui/material/Unstable_Grid2';
import Typography from '@mui/material/Typography';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import { CardActionArea, Button, TextField, ButtonGroup } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';

import { useNavigate } from 'react-router-dom';
import Footer from './footer';

const Home = () => {
    const navigate = useNavigate();
    return (
        <>
            <Grid container justifyContent={'center'} mt={2}>
                <Grid xs={8}>
                    <TextField
                        id='1'
                        label=''
                        variant='outlined'
                        color='primary'
                        size='small'
                        // value={}
                        // onChange={}
                        sx={{ width: '100%' }}
                    />
                </Grid>
                <Grid sm={1}>
                    <Button
                        color='primary'
                        aria-label='upload picture'
                        component='label'
                        variant='outlined'
                        size='large'
                    >
                        <SearchIcon />
                    </Button>
                </Grid>
            </Grid>
            <Grid
                container
                spacing={{ xs: 2, md: 4, lg: 5 }}
                // columns={{ xs: 4, sm: 8, md: 12 }}
                style={{ margin: '1rem' }}
            >
                {Array.from(Array(6)).map((_, index) => (
                    <Grid xs={2} sm={4} md={4} key={index}>
                        <Card sx={{ maxWidth: 345 }} onClick={() => navigate('course')}>
                            <CardActionArea>
                                <CardMedia
                                    component='img'
                                    image='https://mui.com/static/images/cards/contemplative-reptile.jpg'
                                    alt='green iguana'
                                />
                                <CardContent>
                                    <Typography gutterBottom variant='h5' component='div'>
                                        Lizard
                                    </Typography>
                                    <Typography variant='body2' color='text.secondary'>
                                        Lizards are a widespread group of squamate reptiles, with over 6,000 species,
                                        ranging across all continents except Antarctica
                                    </Typography>
                                </CardContent>
                            </CardActionArea>
                        </Card>
                    </Grid>
                ))}
            </Grid>
            <ButtonGroup variant='outlined' color='primary' aria-label='' align='center'>
                <Button>1</Button>
                <Button>2</Button>
            </ButtonGroup>
            <Footer />
        </>
    );
};
export default Home;
